<script>


  function onHeaderClick() {
    document.body.classList.add('scroll-out-animation')

    setTimeout(() => {
      location.href = '/#title';
    }, 1000);
  }

  let isScrolling = false;
  function scrollBottom() {
    console.log("Scrolling to the bottom...");
    window.scrollTo(0, document.body.scrollHeight);
    setInterval(() => window.scrollTo(0, document.body.scrollHeight), 500)
    document.body.style.overflow = "hidden"
  }

  function onElementInView(id) {
    //   
    const element = document.getElementById(id);

    function checkPosition(element) {
      const position = element.getBoundingClientRect();

      if (position.top < window.innerHeight) {
        if (!isScrolling) {
          isScrolling = true;
          curtainFall()
        }
      }
    }

    window.addEventListener('scroll', function () {
      checkPosition(element)
    })
  }

  function curtainFall() {
    console.log("Going to project and stuff")
    scrollBottom()
    setInterval(() => {
      location.href = '/projects-and-stuff';
    }, 1000); // animation length
  }
</script>

  #bottom-nonscroll-spacer {

    background-color: white;

  }

  #bottom-scroll-spacer {

    background: linear-gradient(180deg,
        rgba(255, 255, 255, 0) 0%,
        #23272D 100%);
  }

  #bottom-color-spacer {
    height: 500vh;
